description:
Copied from DAEMON Tools Homepage:


DAEMON Tools is an advanced application for Microsoft Windows which provides one of the best optical media emulation in the industry. DAEMON Tools enables you to use your CD/DVD images as if they were already burned to CD/DVD.

DAEMON Tools forum: www.daemon-tools.cc

Changes in DT 4.30.2 compared to the previous version 4.30.1:

What's new:
- CD/DVD/BluRay imaging ability;
- Images mounting from image catalog in menu;
- Auto update functionality;
- Preferences dialog;
- Some GUI improvements;
- Languages updates.

Bugs fixed:
- Images engine bugs;
- Device speed detection;
- Some minor GUI bugs.
